import React from 'react';

const SingleOffer = (props) => {
    const data = {...props.props}
    return(
        <tr key={props._id}>
            {console.log(data)}
            <td>{props.title}</td>
            <td><a href={props.link} rel="noopener noreferrer" target="_blank">Go to the offer</a></td>
            <td>{props.company}</td>
            <td>{props.country}</td>
            <td>{props.city}</td>
            <td>{props.field}</td>
            <td>{props.paygrade}</td>
            <td>{props.favorite}</td>
            <td>{props.applied}</td>
            <td>{props.description}</td>
            <td>{props.stage1}</td>
            <td>{props.stage2}</td>
            <td>{props.stage3}</td>
            <td>{props.gotTheJob}</td>
        </tr>
    )
}

export default SingleOffer;
